import React, { useEffect, useState } from "react";
import axios from "axios";

const DisplayStocks = () => {
  const [stocks, setStocks] = useState([]);

  const onClickHandle = (e) => {
    e.preventDefault();
    console.log("Click Triggered");
    axios
      .get("http://localhost:8000/api")
      .then((allStocks) => {
        console.log(allStocks.data.stock);
        setStocks(allStocks.data.stock);
        console.log(stocks);
      })
      .catch((err) => console.log(err));
  };
  return (
    <div>
      <button onClick={onClickHandle}>Click to Show Prices!</button>
      {stocks.map((stocks, index) => {
        <div key={index}>
          <p>Bitcoin Exchange 1: {stocks.Bit1}</p>
          <p>Bitcoin Exchange 2: {stocks.Bit2}</p>
          <p>Ethereum Exchange 1: {stocks.Eth1}</p>
          <p>Ethereum Exchange 2: {stocks.Eth2}</p>
        </div>;
      })}
    </div>
  );
};

export default DisplayStocks;
